import React from 'react';

const Footer = () => {
  return (
    <footer style={{ backgroundColor: '#E3EDED', padding: '20px' }}>
      <div style={{ textAlign: 'center' }}>
        <a href="/">Home</a> | <a href="/discussion">Discussion</a> | <a href="/contact">Contact</a> | <a href="/courses">Courses</a> | <a href="/about-us">About Us</a>
      </div>

      <div style={{ marginTop: '20px', textAlign: 'center' }}>
        {/* Replace the social media icons and links with your own */}
        <a href="https://facebook.com" target="_blank" rel="noopener noreferrer">
          <img src="facebook-icon.png" alt="Facebook" style={{ width: '30px', marginRight: '10px' }} />
        </a>
        <a href="https://twitter.com" target="_blank" rel="noopener noreferrer">
          <img src="twitter-icon.png" alt="Twitter" style={{ width: '30px', marginRight: '10px' }} />
        </a>
        <a href="https://instagram.com" target="_blank" rel="noopener noreferrer">
          <img src="instagram-icon.png" alt="Instagram" style={{ width: '30px', marginRight: '10px' }} />
        </a>
      </div>
    </footer>
  );
};

export default Footer;
